import React from 'react'
import { FaMinus } from "react-icons/fa";
import "../styles/Socia.css";


function socialside() {
  return (
    <div>

	<ul class="toolbar cf">
		<li><a href="#"><i class="icon-github"><FaMinus></FaMinus></i></a></li>
		<li><a href="#"><i class="icon-twitter"><FaMinus></FaMinus></i></a></li>
		<li><a href="#"><i class="icon-facebook"><FaMinus></FaMinus></i></a></li>
		<li><a href="#"><i class="icon-linkedin"><FaMinus></FaMinus></i></a></li>
	</ul>
    </div>
  )
}

export default socialside
